// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.6.9;

import "../tokenization/PToken.sol";
import "../tokenization/PErc20.sol";
import "./PriceOracle.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";


contract NestPriceOracle is PriceOracle {
    using SafeMath for uint256;

    mapping(address => uint) prices;
    Nest_3_VoteFactory _voteFactory;

    constructor (address voteFactory) public {
        _voteFactory = Nest_3_VoteFactory(address(voteFactory));
    }

    function UpdateAndGetUnderlyingPrice(PToken pToken) external payable override returns (uint256) {
        if (compareStrings(pToken.symbol(), "pETH")) {
            return 1e18;
        }

        address underlyingToken = address(PErc20(address(pToken)).underlying());
        Nest_3_OfferPrice _offerPrice = Nest_3_OfferPrice(address(_voteFactory.checkAddress("nest.v3.offerPrice")));
        uint256 priceCost = _offerPrice.checkPriceCostMost(underlyingToken);

        require(msg.value >= priceCost, "No enough balance to pay oracle price.");

        (uint256 ethAmount, uint256 tokenAmount,) = _offerPrice.updateAndCheckPriceNow{value: priceCost}(underlyingToken);
        uint256 ethMultiple = ethAmount.div(1 ether);
        uint256 tokenForEth = tokenAmount.div(ethMultiple);



        return tokenForEth;
    }

    function compareStrings(string memory a, string memory b) internal pure returns (bool) {
        return (keccak256(abi.encodePacked((a))) == keccak256(abi.encodePacked((b))));
    }

    function getUnderlyingPrice(PToken pToken) public view override returns (uint) {
        if (compareStrings(pToken.symbol(), "pETH")) {
            return 1e18;
        } else {
            return prices[address(PErc20(address(pToken)).underlying())];
        }
    }
}


interface Nest_3_VoteFactory {
    // 查询地址
    function checkAddress(string calldata name) external view returns (address contractAddress);
}

// 价格合约
interface Nest_3_OfferPrice {
    // 激活使用价格合约
    function activation() external;
    // 更新并查看最新价格
    function updateAndCheckPriceNow(address tokenAddress) external payable returns(uint256 ethAmount, uint256 erc20Amount, uint256 blockNum);
    // 更新并查看生效价格列表
    function updateAndCheckPriceList(address tokenAddress, uint256 num) external payable returns (uint256[] memory);
    // 查看获取价格eth最多费用
    function checkPriceCostMost(address tokenAddress) external view returns(uint256);
}
